import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import {
    Box,
    Button,
    Input,
    FormControl,
    Label,
    HelperMessage,
    useLoading,
    Modal,
    ModalOverlay,
    ModalCloseButton,
    ModalHeader,
    ModalBody,
    ModalFooter,
    useDisclosure,
    useAnimation
} from '@yamada-ui/react';
import AnimatePage from './AnimatePage';

function Signin() {
    const { screen } = useLoading();
    const [isSubmitting, setSubmitting] = useState(false);
    const [userID, setUserID] = useState('');
    const [password, setPassword] = useState('');
    const { isOpen, onOpen, onClose } = useDisclosure();

    const colorChangeAnimation = useAnimation({
        keyframes: {
            '0%': { bg: 'blue.500' },
            '25%': { bg: 'green.500' },
            '50%': { bg: 'yellow.500' },
            '75%': { bg: 'red.500' },
            '100%': { bg: 'blue.500' },
        },
        duration: '10s',
        iterationCount: 'infinite',
        timingFunction: 'linear'
    });

    const handleLogin = async (event) => {
        event.preventDefault();
        if (!userID || !password || password.length < 6) {
            onOpen();
            return;
        }
        setSubmitting(true);
        screen.start();

        try {
            await new Promise(resolve => setTimeout(resolve, 2000)); // Sample delay simulation
        } finally {
            setSubmitting(false);
            screen.finish();
        }
    };

    return (
        <AnimatePage direction="right">
        <div className="container">
            <Box flex="1" w="full" h="100vh" animation={colorChangeAnimation} display="flex" alignItems="center" justifyContent="center">
                <p>Welcome to the login page</p>
            </Box>
            <div className="right-panel">
                <form onSubmit={handleLogin}>
                    <FormControl isRequired label="ユーザーID" errorMessage={!userID && "ユーザーIDは必須です。"}>
                        <Label>ユーザーID</Label>
                        <Input type='text' placeholder='ユーザーID' value={userID} onChange={(e) => setUserID(e.target.value)} />
                        <HelperMessage>IDを入力してください。</HelperMessage>
                    </FormControl>
                    <FormControl isRequired label="パスワード" errorMessage={!password ? "パスワードは必須です。" : (password.length < 6 && "パスワードは6文字以上必要です。")}>
                        <Label>パスワード</Label>
                        <Input type='password' placeholder='パスワード' value={password} onChange={(e) => setPassword(e.target.value)} />
                    </FormControl>
                    <Button type='submit' isLoading={isSubmitting} loadingText="ログイン中...">ログイン</Button>
                    <div className="additional-links">
                        <Link to="/resetpass">パスワードをお忘れの方</Link>
                        <Link to="/signup"><Button>新規登録</Button></Link>
                    </div>
                </form>
                <Modal isOpen={isOpen} onClose={onClose}>
                    <ModalOverlay />
                    <ModalCloseButton />
                    <ModalHeader>入力エラー</ModalHeader>
                    <ModalBody>すべての必須項目を適切に入力してください。パスワードは6文字以上である必要があります。</ModalBody>
                    <ModalFooter>
                        <Button onClick={onClose}>閉じる</Button>
                    </ModalFooter>
                </Modal>
            </div>
        </div>
        </AnimatePage>
    );
}

export default Signin;
